import React, { Component } from "react";
import ParkComponent from "./parkcomponent.js";

class Home extends Component {
  render() {
    return (
      <div className="container">
        <div className="component">
          <ParkComponent />
        </div>
      </div>
    );
  }
}

export default Home;
